import React from 'react'
import ReactDOM from 'react-dom'


const App = () =>{
    return(
        <div>
            <h1> Ashim</h1>
            <p>
this is a good practice to do anything This was also part of routine. A fewe seconds of hesitation to see if something else would be added to the 
order before demuring and saying that would be all. It was the same exact meal that he had ordered every day for the past two years            </p>
        </div>
    )
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
)
